DROP TABLE IF EXISTS er_visits;

CREATE TABLE er_visits (
    visit_id INTEGER,
    patient_id INTEGER,
    visit_datetime TIMESTAMP,
    chief_complaint TEXT,
    severity TEXT,
    wait_time_minutes INTEGER,
    treatment_duration_minutes INTEGER,
    attending_staff_id INTEGER,
    outcome TEXT,
    medicines_prescribed TEXT,
    total_cost REAL,
    created_at TIMESTAMP,
    updated_at TIMESTAMP
);

